//import logo from './logo.svg';
import './App.css';
import React from "react";
import {
  BrowserRouter as Router, 
  Switch,
  Route,
  Link
} from "react-router-dom"

function App() {
  return (
    <Router>
      <div className="App">
       <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <div class="container-fluid">
        <img src='logo-ind.svg' width="400px" height="100px"></img>
        <div class="collapse navbar-collapse" id="navbarNav">
          <ul class="navbar-nav">
            <li class="nav-item">
              {/* <a class="nav-link active" aria-current="page" href="#">Home</a> */}
              <Link to="/">Home</Link>
            </li>
            <li class="nav-item">
              <Link class="nav-link" to="/">Products</Link>
            </li>
            <li class="nav-item">
              <Link to="/services">Services</Link>
            </li>
            <li class="nav-item">
              <Link to="/clients">Clients</Link>
            </li>
            <li class="nav-item">
              <Link to="/contact">Contact</Link>
            </li>
            <li class="nav-item">
              <Link to="/about">About</Link>
            </li>
          </ul>
        </div>
        </div>
      </nav>
      <Switch>
          <Route path="/products">
            <Products />
          </Route>
          <Route path="/services">
            <Services />
          </Route>
          <Route path="/contactus">
            <Contact />
          </Route>
          <Route path="/aboutus">
            <About />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>    
  );
}

function Home() {
  return <h2>Homa</h2>;
}

function Products() {
  return <h2>Products</h2>;
}

function Services() {
  return <h2>Services</h2>;
}

function Contact() {
  return <h2>About</h2>;
}

function About() {
  return <h2>About</h2>;
}


export default App;
